import React, { useEffect, useState } from "react";
import './Doctprofile.css';
import axios from "axios";
import { Card, Container, Row, Table ,Button} from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faPlus} from '@fortawesome/free-solid-svg-icons';
function Doctprofile() {
    const [person, setperson] = useState(Array);

    useEffect(() => {
        axios.get("http://localhost:5000/doctor")
            .then(res => {
                setperson(res.data.dr);
            });
    }, [])

    function deletedoct(e) {
        console.log(e.target.id);
    }

    const [showspain, setshowspain] = useState(false);

    function funshowspain(){
        setshowspain(true);
    }

    return (
        <Container>
            {person.map((user) => (
                <Row className="row">
                    {user.map((users) => (
                        <Card style={{ width: '25rem' ,padding:'0px'}}>
                            <Card.Img variant="top" src={process.env.PUBLIC_URL + '/dr1.jpg'} />
                            <Table style={{margin:'5px'}}>
                                <tbody>
                                    <tr>
                                        <td>Dr.Name</td>
                                        <td>{users.name}</td>
                                    </tr>
                                    <tr>
                                        <td>Dr.Specialised</td>
                                        <td>{users.specialised}</td>
                                    </tr>
                                    <tr>
                                        <td>Dr.Home Work</td>
                                        <td>{users.hourwork}</td>
                                    </tr>
                                </tbody>
                                <Button className="btnadd" id={users._id} onMouseOver={funshowspain} onClick={deletedoct}  variant="success"> Add <FontAwesomeIcon icon={faPlus} ></FontAwesomeIcon></Button>
                            </Table>
                        </Card>
                    ))}
                </Row>
            ))}
        </Container>
    );
}


export default Doctprofile;
